<template>
  <navbar :isHome="false" />
  <view class="img-full-screen">
    <image style="position: absolute; width: 100vw; height: 100vh; left: 0vw; top: -30vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <image style="position: absolute; width: 20vw; height: 5vh; left: 35vw; top: 5vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <!-- 筛选栏 -->
    <view class="container" style="position: absolute; width: 85vw; height: 5vh; left: 7vw; top: 15vh; font-size: 4vw;">
      <!-- 灯颜色选择框 -->
      <picker mode="selector" :range="lights" @change="onLightChange"
        style="position: absolute; width: 20vw; height: 3vh; left: 0vw; top: 0vh; border: 2rpx solid #cbae59; border-radius: 25rpx;">
        <view class="picker">
          <text
            style="color: #967e4e; font-weight: 800; padding-left: 3vw;">{{ !selectedLight ? '灯颜色' : selectedLight }}</text>
        </view>
      </picker>
      <image v-if="!selectedLight" style="position: absolute; width: 3vw; height: 3vh; left: 16vw; top: 0.5vh;"
        src="data:image/svg+xml;base64,PHN2ZyB3aWR0aD0iNiIgaGVpZ2h0PSI1IiB2aWV3Qm94PSIwIDAgNiA1IiBmaWxsPSJub25lIiB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciPjxwYXRoIGQ9Ik0xIDFsMiAyIDItMiIgc3Ryb2tlPSIjOTY3RTRFIiBzdHJva2Utd2lkdGg9IjEuNSIgc3Ryb2tlLWxpbmVjYXA9InJvdW5kIi8+PC9zdmc+">
      </image>

      <!-- 身体部位选择框 -->
      <picker mode="selector" :range="bodyParts" @change="onBodyPartChange"
        style="position: absolute; width: 24vw; height: 3vh; left: 22vw; top: 0vh; border: 2rpx solid #cbae59; border-radius: 25rpx;">
        <view class="picker">
          <text
            style="color: #967e4e; font-weight: 800; padding-left: 3vw;">{{ !selectedBodyPart ? '身体部位' : selectedBodyPart }}</text>
        </view>
      </picker>
      <image v-if="!selectedBodyPart" style="position: absolute; width: 3vw; height: 3vh; left: 42vw; top: 0.5vh;"
        src="data:image/svg+xml;base64,PHN2ZyB3aWR0aD0iNiIgaGVpZ2h0PSI1IiB2aWV3Qm94PSIwIDAgNiA1IiBmaWxsPSJub25lIiB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciPjxwYXRoIGQ9Ik0xIDFsMiAyIDItMiIgc3Ryb2tlPSIjOTY3RTRFIiBzdHJva2Utd2lkdGg9IjEuNSIgc3Ryb2tlLWxpbmVjYXA9InJvdW5kIi8+PC9zdmc+">
      </image>

      <!-- 故事主题选择框 -->
      <picker mode="selector" :range="storyThemes" @change="onStoryThemeChange"
        style="position: absolute; width: 36vw; height: 3vh; left: 48vw; top: 0vh; border: 2rpx solid #cbae59; border-radius: 25rpx;">
        <view class="picker">
          <text
            style="color: #967e4e; font-weight: 800; padding-left: 3vw;">{{ !selectedStoryTheme ? '故事主题' : selectedStoryTheme }}</text>
        </view>
      </picker>
      <image v-if="!selectedStoryTheme" style="position: absolute; width: 3vw; height: 3vh; left: 80vw; top: 0.5vh;"
        src="data:image/svg+xml;base64,PHN2ZyB3aWR0aD0iNiIgaGVpZ2h0PSI1IiB2aWV3Qm94PSIwIDAgNiA1IiBmaWxsPSJub25lIiB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciPjxwYXRoIGQ9Ik0xIDFsMiAyIDItMiIgc3Ryb2tlPSIjOTY3RTRFIiBzdHJva2Utd2lkdGg9IjEuNSIgc3Ryb2tlLWxpbmVjYXA9InJvdW5kIi8+PC9zdmc+">
      </image>
    </view>

    <!-- 故事单 v-for遍历 -->
    <view v-for="(story, index) in collectedStories" :key="index">
      <image @click="onStoryTap(story.body, story.color, story.topic)"
        :style="`position: absolute; width: 90vw; height: 13vh; left: 5vw; top: ${computePosition(index)}vh;`"
        src="data:image/svg+xml;base64,">
      </image>

      <image :style="`position: absolute; width: 14vw; height: 13vh; left: 9.5vw; top: ${computePosition(index)}vh;`"
        src="data:image/svg+xml;base64,">
      </image>

      <view
        :style="`position: absolute; display: flex ;width: 65vw; height: 5vh; left: 26vw; top: ${computePosition(index) + 5.5}vh;`">
        <image style="height: 3vh; width: 15vw; padding-right: 1vw;" :src="getBodyImageSource(story.body)">
        </image>
        <image style="height: 3vh; width: 18vw; padding-right: 1vw;" :src="getColorImageSource(story.color)">
        </image>
        <image style="height: 3vh; width: 22vw;" :src="getTopicImageSource(story.topic)">>
        </image>
      </view>

      <text
        :style="`position: absolute; width: 65vw; height: 5vh; left: 28vw; top: ${computePosition(index) + 9.2}vh; font-size: 26rpx; font-weight: 400;`">
        {{ story.title }}
      </text>
    </view>

  </view>
</template>

<script>
  export default {
    data() {
      return {
        lights: ['红', '绿', '黄'],
        bodyParts: ['脸部', '头部', '肩部', '胸部', '腹部', '臀部', '阴部', '腿部', '脚部'],
        storyThemes: ['权利和价值观', '性与性行为', '关系', '文化与性', '人体与发育', '暴力和安全保障', '理解性别', '性与生殖健康'],
        selectedLight: null,
        selectedBodyPart: null,
        selectedStoryTheme: null,

        collectedStories: []
      }
    },
    mounted() {
      this.getCollectedStories();
    },
    methods: {
      onLightChange(event) {
        this.selectedLight = this.lights[event.detail.value];
        this.getCollectedStories(this.selectedBodyPart, this.selectedLight, this
          .selectedStoryTheme);
      },
      onBodyPartChange(event) {
        this.selectedBodyPart = this.bodyParts[event.detail.value];
        this.getCollectedStories(this.selectedBodyPart, this.selectedLight, this
          .selectedStoryTheme);
      },
      onStoryThemeChange(event) {
        this.selectedStoryTheme = this.storyThemes[event.detail.value];
        this.getCollectedStories(this.selectedBodyPart, this.selectedLight, this
          .selectedStoryTheme);
      },
      onPartChange(value) {
        this.selectPart = value;
      },
      getCollectedStories(body = null, color = null, topic = null) {
        uni.request({
          url: 'https://dida.012331.com/get/collected/story/',
          method: 'POST',
          data: {
            body: body,
            color: color,
            topic: topic,
            openid: uni.getStorageSync('openid')
          },
          success: (res) => {
            if (res.data.result === 'success') {
              this.collectedStories = res.data.collected_stories;
            } else {
              uni.showToast({
                title: '获取收藏的故事列表失败',
                icon: 'none'
              });
            }
          },
          fail: (err) => {
            console.error('请求失败', err);
            uni.showToast({
              title: '请求失败，请重试',
              icon: 'none'
            });
          }
        });
      },
      computePosition(index) {
        // 起始高度为20 每个标签占13
        return (20 + index * 14)
      },
      getBodyImageSource(body) {
        switch (body) {
          case '头部':
            return 'data:image/svg+xml;base64,';
          case '脸部':
            return 'data:image/svg+xml;base64,';
          case '肩部':
            return 'data:image/svg+xml;base64,';
            // 无臀部
          case '臀部':
            return 'data:image/svg+xml;base64,';
          case '腹部':
            return 'data:image/svg+xml;base64,';
          case '阴部':
            return 'data:image/svg+xml;base64,';
          case '腿部':
            return 'data:image/svg+xml;base64,';
          case '脚部':
            return 'data:image/svg+xml;base64,';
          case '胸部':
            return 'data:image/svg+xml;base64,';
        }
      },
      getColorImageSource(color) {
        switch (color) {
          case '绿':
            return 'data:image/svg+xml;base64,';
          case '黄':
            return 'data:image/svg+xml;base64,';
          case '红':
            return 'data:image/svg+xml;base64,';
        }
      },
      getTopicImageSource(topic) {
        switch (topic) {
          case '权利和价值观':
            return 'data:image/svg+xml;base64,';
          case '性与性行为':
            return 'data:image/svg+xml;base64,';
          case '关系':
            return 'data:image/svg+xml;base64,';
          case '文化与性':
            return 'data:image/svg+xml;base64,';
          case '人体与发育':
            return 'data:image/svg+xml;base64,';
          case '暴力和安全保障':
            return 'data:image/svg+xml;base64,';
          case '理解性别':
            return 'data:image/svg+xml;base64,';
          case '性与生殖健康':
            return 'data:image/svg+xml;base64,';
        }
      },
      onStoryTap(body, color, topic) {
        uni.navigateTo({
          url: '/pagesE/display/story_page?body=' + body + '&color=' + color + '&topic=' + topic
        })
      },
    }
  }
</script>

<style scoped>
  .img-full-screen {
    height: 100vh;
    width: 100vw;
    background-color: #ffde6c;
  }

  .container {
    display: flex;
    flex-direction: column;
    align-items: center;
  }
</style>